import React from 'react';

function CharacterListItem(props){
    const { character } = props;
    return(
        <div>
            <img src={`${character.thumbnail.path}/portrait_medium.${character.thumbnail.extension}`}/>
        </div>
    );
}

export default CharacterListItem;
